  CheckBox,
  ViewPropTypes,
} from 'react-native';


export default function FirstRdv(props) {
    return (
        <View>
          <Text> "Is this your first appointment with this practitioner?"
          </Text>
          <Appointment style={styles.container}></Appointment>
        </View> 
    )
};

function Appointment(props) {
    return (
        <View style={styles.container}>
            <View style={[styles.checkBoxStyleRight, {"float": "left"}]}>
                <CheckBox style={[{"float": "left"}]}></CheckBox>
                <Text style={[{"float": "right"}]}> Yes </Text>
            </View>
            <View style={[styles.checkBoxStyleLeft, {"float": "right"}]}>
                <CheckBox style={[{"float": "left"}]}></CheckBox>
                <Text style={[{"float": "right"}]}> No </Text>
            </View>
        </View>
    )

}

const styles = StyleSheet.create({
    container: {
        display: "inline-block",
    },
    checkBoxStyleLeft: {
        display: "inline-block",
    },
    checkBoxStyleRight: {
        display: "inline-block",
    } 
})


